import {
    LIST_ORDER_REQUEST,
    LIST_ORDER_SUCCESS,
    LIST_ORDER_ERROR
} from './orderTypes'
export const getOrderListRequest = () => {
    return {
        type:LIST_ORDER_REQUEST
    }
}

export const getOrderListSuccess = () => {
    return {
        type:LIST_ORDER_SUCCESS
    }
}

export const getOrderListError = (error) => {
    return {
        type:LIST_ORDER_ERROR,
        payload:error
    }
}



export const getOrderList = () => {
    return {
        type:LIST_ORDER
    }
}
